import React from "react";
import './register.css';

const Register = () => {

    return (
        <div className=" w-full py-16 text-white px-4 bg-yellow-600">
            <div className="max-w-screen-xl mx-auto grid lg:grid-cols-3 bg-white py-10 ">
                <div className="lg:col-span-2 py-2 bg-blue-600">
                    <h1>PICTURE</h1>
                </div>
                <div className="bg-red-600 py-2 px-2">
                    <h1> LOGIN FORM </h1>
                </div>
            </div>
        </div>
    );
};

export default Register;
